import React, { useState, useEffect } from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';

const StudentMonitoring = () => {
  const [logs, setLogs] = useState([]);
  const [performance, setPerformance] = useState([]);
  const [attendance, setAttendance] = useState([]);
  const [timetable, setTimetable] = useState([]);
  const [results, setResults] = useState([]);
  const [upcomingTests, setUpcomingTests] = useState([]);

  const token = localStorage.getItem('token');
  const headers = { Authorization: `Bearer ${token}` };

  // Fetch monitoring logs
  useEffect(() => {
    axios.get('/api/monitoring', { headers })
      .then(res => setLogs(res.data))
      .catch(err => alert('Failed to fetch monitoring logs'));

    // Fetch performance
    axios.get('/api/performance', { headers })
      .then(res => setPerformance(res.data))
      .catch(err => console.log('Failed to fetch performance'));

    // Fetch attendance
    axios.get('/api/attendance', { headers })
      .then(res => setAttendance(res.data))
      .catch(err => console.log('Failed to fetch attendance'));

    // Fetch timetable
    axios.get('/api/timetable', { headers })
      .then(res => setTimetable(res.data))
      .catch(err => console.log('Failed to fetch timetable'));

    // Fetch results
    axios.get('/api/results', { headers })
      .then(res => setResults(res.data))
      .catch(err => console.log('Failed to fetch results'));

    // Fetch upcoming tests
    axios.get('/api/upcoming-tests', { headers })
      .then(res => setUpcomingTests(res.data))
      .catch(err => console.log('Failed to fetch upcoming tests'));
  }, []);

  return (
    <div className="container mt-5">
      <h3>Student Dashboard</h3>

      {/* Monitoring Logs */}
      <h4>Monitoring Logs</h4>
      <table className="table mb-4">
        <thead>
          <tr>
            <th>Action</th>
            <th>Timestamp</th>
          </tr>
        </thead>
        <tbody>
          {logs.map(log => (
            <tr key={log.id}>
              <td>{log.action}</td>
              <td>{log.timestamp}</td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* Performance */}
      <h4>Performance</h4>
      <ul className="list-group mb-4">
        {performance.map((item, index) => (
          <li key={index} className="list-group-item">
            {item.subject}: {item.grade}
          </li>
        ))}
      </ul>

      {/* Attendance */}
      <h4>Attendance</h4>
      <ul className="list-group mb-4">
        {attendance.map((att, index) => (
          <li key={index} className="list-group-item">
            {att.date}: {att.status}
          </li>
        ))}
      </ul>

      {/* Timetable */}
      <h4>Timetable</h4>
      <table className="table mb-4">
        <thead>
          <tr>
            <th>Day</th>
            <th>Time</th>
            <th>Subject</th>
            <th>Venue</th>
          </tr>
        </thead>
        <tbody>
          {timetable.map((entry, index) => (
            <tr key={index}>
              <td>{entry.day}</td>
              <td>{entry.time}</td>
              <td>{entry.subject}</td>
              <td>{entry.venue}</td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* Results */}
      <h4>Results</h4>
      <table className="table mb-4">
        <thead>
          <tr>
            <th>Subject</th>
            <th>Grade</th>
            <th>Remarks</th>
          </tr>
        </thead>
        <tbody>
          {results.map((res, index) => (
            <tr key={index}>
              <td>{res.subject}</td>
              <td>{res.grade}</td>
              <td>{res.remarks}</td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* Upcoming Tests */}
      <h4>Upcoming Tests</h4>
      <ul className="list-group mb-4">
        {upcomingTests.map((test, index) => (
          <li key={index} className="list-group-item">
            {test.subject} on {test.date} at {test.time}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default StudentMonitoring;
